import Link from "next/link";
import styled from "styled-components";
import { useAuth } from "use-auth0-hooks";

const Nav = styled.div`
  border-bottom: 1px solid #ccc;
  height: 60px;
  width: 100%;
`;

function Header() {
  return <Nav />;
}

export default Header;
